import React ,{useEffect,useState}from 'react'

const ListEmployees = () => {
    const [Employees, setEmployees] = useState([]);
    useEffect(() => {
        axios.get("/api/user")
        .then(function(res) {
          setEmployees(true);
        })
        .catch(function(error) {
            console.log(error)
        });
      }, []);

  return (
    <div>ListEmployees</div>
  )
}

export default ListEmployees
